            "growth_introductory": [
                {
                    "id": 10003,
                    "name": "През първия месец",
                    "body": "През първите 5 дни новороденото ще загуби до 10% от телесното си тегло, но с подходящи грижи и хранене, предимно кърмене, то ще компенсира тази загуба до края на втората седмица. През следващия период новороденото ще наддава с тегло от 20 до 30 грама на ден, с дължина до 5 cм месечно и с обиколка на главата 2-2,5 cм.",
                    "days_from": 0,
                    "days_to": 30
                },
                {
                    "id": 10004,
                    "name": "През втория и третия месец",
                    "body": "През втория и третия месец детето продължава да расте с приблизително същото темпо, което е установило през първите седмици. То ще наддаде на тегло от 700 до 900 грама на месец, на дължина от 2,5 до 4 cм и на обиколка на главата около 1,2 cм.",
                    "days_from": 31,
                    "days_to": 91
                },
                {
                    "id": 10005,
                    "name": "През петия месец",
                    "body": "Растежът започва да се забавя и през четвъртия, петия и шестия месец детето наддава средно 450-550 грама тегло и около 2 cм дължина",
                    "days_from": 92,
                    "days_to": 152
                },
                {
                    "id": 10007,
                    "name": "През шестия месец",
                    "body": "Детето продължава да наддава на тегло 450-550 грама на месец и около 2 см дължина средно. Към 6-месечна възраст детето вече е удвоило телесното си тегло от раждането си.",
                    "days_from": 153,
                    "days_to": 183
                },
                {
                    "id": 10008,
                    "name": "През деветия месец (обхваща периода 7-9 месец)",
                    "body": "От седмия до деветия месец растежът продължава да се забавя. Децата растат с различно темпо, но е важно да следват модела на растеж, установен през предходните месеци.",
                    "days_from": 184,
                    "days_to": 274
                },
                {
                    "id": 10009,
                    "name": "През 12 месец (обхваща периода 10-12 месец)",
                    "body": "През последния триместър на първата година детето пораства с около 1 см на месец, докато теглото варира и зависи от нивото на активност. В края на първата година детето обикновено е утроило теглото си спрямо това при раждането, нарастнало е средно с 25 см и обиколката на главата се е увеличила с 12,5 см.",
                    "days_from": 275,
                    "days_to": 365
                },
                {
                    "id": 10010,
                    "name": "През втората година",
                    "body": "През втората година продължава постепенното забавяне на растежа. През тази година средно едно дете пораства с около 12 см, качва 2-2,5 кг тегло и обиколката на главата се увеличава с 2-2,5 см.",
                    "days_from": 366,
                    "days_to": 730
                },
                {
                    "id": 10012,
                    "name": "След третата година",
                    "body": "Растежът през от третата година и нататък става по-равномерен. Детето пораства средно с  5-7,5 см ръст и 2-3 кг тегло годишно.",
                    "days_from": 731,
                    "days_to": 2190
                }
            ],
