                    "name": "6 μηνών",
                    "body": "Το παιδί συνεχίζει να κερδίζει 450 με 550 γραμμάρια σε βάρος και περίπου 2 εκατοστά σε μήκος κατά μέσο όρο. Μέχρι την ηλικία των 6 μηνών έχει ήδη διπλασιάσει το βάρος της γέννησης του.  ",
