            "growth_introductory": [
                {
                    "id": 10003,
                    "name": "1 месец",
                    "body": "Во првите 5 дена, новороденчето ќе изгуби до 10% од својата тежина, но со соодветна нега и исхрана, првенствено доење, ќе ја надоместат тежината до крај на втората недела по раѓање. Во следниот период, новороденчето ќе добива по 20-30 грама тежина на ден, 5 цм месечно во должина и 2-2.5 цм во обемот на главата",
                    "days_from": 0,
                    "days_to": 30
                },
                {
                    "id": 10004,
                    "name": "2 месеци, 3 месеци",
                    "body": "Во вториот и третиот месец, детето продолжува да расте со приближно истото темпо кое го има во првите недели. Тоа ќе добива 700-900 грама месечно на тежина, 2.5-4 цм во должина и околу 1.2 цм во обемот на главата ",
                    "days_from": 31,
                    "days_to": 91
                },
                {
                    "id": 10005,
                    "name": "5 месеци (ги опфаќа  и 5 месеци)",
                    "body": "Растењето почнува да забавува и за време на четвртиот, петтиот и шестиот месец, детето добива просечно по 450-550 грама во тежина и околу 2 цм во должина",
                    "days_from": 92,
                    "days_to": 152
                },
                {
                    "id": 10007,
                    "name": "6 месеци",
                    "body": "Детето продолжува да добива 450-550 грама месечно во тежина и околу 2 цм во должина. Кога ќе наполни 6 месеци, детето има дупло поголема тежина од онаа пред раѓање",
                    "days_from": 153,
                    "days_to": 183
                },
                {
                    "id": 10008,
                    "name": "9 месеци (опфаќа од 7-9 месеци)",
                    "body": "Од седмиот до деветтиот месец, растењето почнува да забавува. Децата растат со различно темпо, но многу е важно да се следи начинот на раст во претходните месеци ",
                    "days_from": 184,
                    "days_to": 274
                },
                {
                    "id": 10009,
                    "name": "12 месеци (опфаќа од 10-12 месеци)",
                    "body": "Во последниот тримесечен период од првата година, детето расте околу 1 цм месечно, додека тежината варира и зависи од нивото на активност. Во првата година, детето обично трипати ја зголемува својата тежина споредено со родилната, расте просечно 25 цм, а обемот на главата се зголемува за 12.5 цм.",
                    "days_from": 275,
                    "days_to": 365
                },
                {
                    "id": 10010,
                    "name": "18 месеци (ја опфаќа втората година)",
                    "body": "Во втората година, продолжува постепеното забавување на растот. Во тек на оваа година, детето расте околу 12 цм, добива 2-2.5 кг во тежина а обемот на главата се зголемува за 2-2.5 цм",
                    "days_from": 366,
                    "days_to": 730
                },
                {
                    "id": 10012,
                    "name": "3 години и постаро",
                    "body": "Растот од третата година натаму станува се порамномерен. Детето расте 5-7.5 цм во висина и добива 2-3 кг во тежина годишно",
                    "days_from": 731,
                    "days_to": 2190
                }
            ],
