            "growth_introductory": [
                {
                    "id": 10003,
                    "name": "1 mesec",
                    "body": "Novorođenče će na početku izgubiti do 10% svoje telesne mase (težine), a ovaj gubitak će, uz odgovarajuću negu i ishranu, najbolje majčinim mlekom, nadoknaditi najdalje do kraja druge nedelje života. Sledi period najbržeg rasta: u težini  20 do 30 gr dnevno, a mesečno u dužini do 5 cm, u obimu glave  2 -2,5 cm.",
                    "days_from": 0,
                    "days_to": 30
                },
                {
                    "id": 10004,
                    "name": "2 mesec, 3 mesec",
                    "body": "U drugom i trećem mesecu dete nastavlja da raste približno istom brzinom koju je uspostavilo tokom prvih nedelja. Mesečno dobija 700 do 900 gr u težini, 2,5 do 4 cm u dužini i oko 1,2 cm u obimu glave.",
                    "days_from": 31,
                    "days_to": 91
                },
                {
                    "id": 10005,
                    "name": "5 meseci (pokriva 4 i 5 mesec)",
                    "body": "U četvrtom mesecu rast počinje da se usporava. Tokom četvrtog i petog meseca, dete mesečno dobija u proseku 450 do 550 gr u težini i oko 2 cm u dužini",
                    "days_from": 92,
                    "days_to": 152
                },
                {
                    "id": 10007,
                    "name": "6 meseci",
                    "body": "Dete nastavlja da dobija mesečno proseku 450 do 550 gr u težini i oko 2 cm u dužini. Dok navrši 6 meseci dete je već udvostručilo telesnu masu sa rođenja.",
                    "days_from": 153,
                    "days_to": 183
                },
                {
                    "id": 10008,
                    "name": "9 meseci (pokriva 7 do 9 meseci)",
                    "body": "Od sedmog do devetog meseca rast se i dalje usporava. Deca rastu različitom brzinom ali je važno da slede obrazac rasta koji su uspostavila tokom predhodnih meseci.",
                    "days_from": 184,
                    "days_to": 274
                },
                {
                    "id": 10009,
                    "name": "12 meseci (pokriva od 10 do 12 meseci)",
                    "body": "U poslednjem tromesečju prve godine dete dobija oko 1 cm mesečno u dužini a težina varira i zavisi od aktivnosti. Tokom prve godine dete uglavnom utrostruči svoju težinu sa rođenju, poraste u proseku  25 cm a obim glave se poveća za 12,5 cm",
                    "days_from": 275,
                    "days_to": 365
                },
                {
                    "id": 10010,
                    "name": "18 meseci (pokriva drugu godinu)",
                    "body": "U drugoj godini se nastavlja postepeno usporavanje rasta. U ovoj godini dete poraste oko 12 cm,  dobije 2-2,5 kg u težini i obim glave se uveća za 2-2,5 cm.",
                    "days_from": 366,
                    "days_to": 730
                },
                {
                    "id": 10012,
                    "name": "3 godine i dalje (treća godina i na dalje)",
                    "body": "Dete od treće godine ujednačeno raste. Dete u visini dobija  5-7,5 cm, a u težini 2-3 kg godišnje.",
                    "days_from": 731,
                    "days_to": 2190
                }
            ],
