            "growth_introductory": [
                {
                    "id": 10003,
                    "name": "1 месяц",
                    "body": "В течение первых 5 дней новорожденный теряет до 10% своей массы тела, но при соответствующем уходе и питании, в первую очередь грудном вскармливании, они компенсируют эту потерю к концу второй недели жизни. В последующий период новорожденный будет прибавлять в весе от 20 до 30 г в день, до 5 см в месяц в длину и 2-2,5 см в окружности головы.",
                    "days_from": 0,
                    "days_to": 30
                },
                {
                    "id": 10004,
                    "name": "2 месяца, 3 месяца",
                    "body": "На втором и третьем месяце ребенок продолжает расти примерно теми же темпами, что и в первые недели. Он будет набирать от 700 до 900 г в месяц в весе, от 2,5 до 4 см в длину и примерно 1,2 см в окружности головы.",
                    "days_from": 31,
                    "days_to": 91
                },
                {
                    "id": 10005,
                    "name": "5 месяцев (охватывает 4-5 месяцы)",
                    "body": "Рост начинает замедляться, и на четвертом, пятом и шестом месяце ребенок набирает в среднем 450-550 г веса и около 2 см в длину.",
                    "days_from": 92,
                    "days_to": 152
                },
                {
                    "id": 10007,
                    "name": "6 месяцев",
                    "body": "Ребенок продолжает набирать в месяц 450-550 грамм в весе и в среднем около 2 см в длину. К 6 месяцам ребенок уже с рождения увеличивает массу тела вдвое.",
                    "days_from": 153,
                    "days_to": 183
                },
                {
                    "id": 10008,
                    "name": "9 месяцев (охватывает с 7 до 9 месяца)",
                    "body": "С седьмого по девятый месяц рост ребенка продолжает замедляться. Дети растут разными темпами, но важно следовать модели роста, установленной в предыдущие месяцы.",
                    "days_from": 184,
                    "days_to": 274
                },
                {
                    "id": 10009,
                    "name": "12 месяцев (охватывает с 10 до 12 месяцев)",
                    "body": "В последнем триместре первого года ребенок набирает около 1 см в месяц, при этом вес варьируется и зависит от уровня его активности. Обычно в течение первого года жизни вес ребенка утраивается, он вырастает в среднем на 25 см,  окружность головы увеличивается на 12,5 см.",
                    "days_from": 275,
                    "days_to": 365
                },
                {
                    "id": 10010,
                    "name": "18 месяцев (охватывает второй год)",
                    "body": "Во второй год жизни продолжается постепенное замедление роста. За этот год ребенок вырастает примерно на 12 см, набирает в весе 2-2,5 кг, а окружность головы увеличивается на 2-2,5 см.",
                    "days_from": 366,
                    "days_to": 730
                },
                {
                    "id": 10012,
                    "name": "3 года и старше (третий год и позже)",
                    "body": "С третьего года жизни рост ребенка становится более равномерным. За год ребенок вырастает на 5-7,5 см и набирает в весе 2-3 кг.  ",
                    "days_from": 731,
                    "days_to": 2190
                }
            ],
